import {FC} from 'react';
import {FormControlLabel,Checkbox} from '@mui/material';


const CustomizableSelector:FC<{isSelected:boolean}> = (props) => {
    return (
        <div className={`${props.isSelected ? 'sm:animate-expand' : 'sm:animate-shrink hover:opacity-[0.8]'} sm:h-[350px] h-[300px]  bg-[#2E49A6] text-white  shadow-2xl border-2 border-[#2E49A6] sm:cursor-pointer max-sm:w-[80%] w-[300px] relative `}>
            <h1 className={'text-[30px] w-full text-center p-2'}>Customize</h1>
            <div className={'p-3'}>
                <FormControlLabel control={<Checkbox  sx={{
                    color: 'white',
                    '&.Mui-checked': {
                        color: 'white',
                    },
                }}/>} label={'Test'}/>
            </div>
        </div>
    );
};

export default CustomizableSelector;
